import {
  ExceptionFilter,
  Catch,
  ArgumentsHost,
  HttpStatus,
  Logger,
} from '@nestjs/common';
import { Prisma } from '@prisma/client';
import { Response, Request } from 'express';

@Catch(Prisma.PrismaClientKnownRequestError)
export class PrismaClientExceptionFilter implements ExceptionFilter {
  private readonly logger = new Logger(PrismaClientExceptionFilter.name);

  catch(exception: Prisma.PrismaClientKnownRequestError, host: ArgumentsHost) {
    const ctx = host.switchToHttp();
    const response = ctx.getResponse<Response>();
    const request = ctx.getRequest<Request>();

    let status = HttpStatus.INTERNAL_SERVER_ERROR;
    let message = 'Internal database error';

    // Log the error details for server diagnostics
    this.logger.error(`${request.method} ${request.url}`, exception.stack);

    switch (exception.code) {
      case 'P2002': {
        status = HttpStatus.CONFLICT;
        const targetMeta = exception.meta?.target as any;
        const target = Array.isArray(targetMeta)
          ? targetMeta.join(', ')
          : typeof targetMeta === 'string'
            ? targetMeta
            : 'unknown target';
        message = `Unique constraint failed on the fields: (${target})`;
        break;
      }
      case 'P2025': {
        status = HttpStatus.NOT_FOUND;
        message = 'Record not found to update or delete';
        break;
      }
      case 'P2003': {
        status = HttpStatus.BAD_REQUEST;
        message = 'Foreign key constraint failed';
        break;
      }
      default:
        // Use generic 500 status and message for unaccounted errors but log the specifics
        this.logger.warn(`Unhandled Prisma Code: ${exception.code}`);
        break;
    }

    response.status(status).json({
      statusCode: status,
      message,
      timestamp: new Date().toISOString(),
      path: request.url,
    });
  }
}

import {
  Controller,
  Post,
  Body,
  Req,
  Headers,
  BadRequestException,
  UseGuards,
  RawBodyRequest,
} from '@nestjs/common';
import {
  ApiTags,
  ApiOperation,
  ApiBody,
  ApiResponse,
  ApiBearerAuth,
  ApiHeader,
  ApiUnauthorizedResponse,
  ApiBadRequestResponse,
} from '@nestjs/swagger';
import { PaymentsService } from './payments.service';
import { JwtAuthGuard } from '../auth/jwt-auth.guard';
import {
  CreateCheckoutSessionDto,
  CheckoutSessionResponseDto,
} from './dto/payment.dto';

@ApiTags('Payments')
@Controller('payments')
export class PaymentsController {
  constructor(private readonly paymentsService: PaymentsService) {}

  @UseGuards(JwtAuthGuard)
  @Post('checkout')
  @ApiBearerAuth()
  @ApiOperation({
    summary: 'Create a Stripe checkout session',
    description:
      'Initiates a Stripe checkout session for the given order. Returns a redirect URL to the Stripe-hosted payment page.',
  })
  @ApiBody({ type: CreateCheckoutSessionDto })
  @ApiResponse({
    status: 201,
    description: 'Checkout session created',
    type: CheckoutSessionResponseDto,
  })
  @ApiUnauthorizedResponse({ description: 'JWT token is missing or invalid' })
  async createCheckoutSession(@Body() body: CreateCheckoutSessionDto) {
    return this.paymentsService.createCheckoutSession(
      body.orderId,
      body.items,
      body.successUrl,
      body.cancelUrl,
    );
  }

  @Post('webhook')
  @ApiOperation({
    summary: 'Stripe webhook handler',
    description:
      'Endpoint for Stripe to send payment event webhooks. Do NOT call this manually â€” it requires a valid Stripe signature header.',
  })
  @ApiHeader({
    name: 'stripe-signature',
    description: 'Stripe webhook signature (automatically sent by Stripe)',
    required: true,
  })
  @ApiResponse({
    status: 200,
    description: 'Webhook received',
    schema: { example: { received: true } },
  })
  @ApiBadRequestResponse({ description: 'Invalid Stripe webhook signature' })
  async handleStripeWebhook(
    @Req() req: { rawBody?: Buffer; body: any },
    @Headers('stripe-signature') signature: string,
  ) {
    let event;
    try {
      const rawBody = req.rawBody || req.body;
      event = await this.paymentsService.constructEvent(rawBody, signature);
    } catch (err: unknown) {
      const msg = err instanceof Error ? err.message : 'Unknown Error';
      throw new BadRequestException(`Webhook Error: ${msg}`);
    }

    if (event.type === 'checkout.session.completed') {
      const session = event.data.object;
      const orderId = session.metadata?.orderId;
      if (orderId) {
        await this.paymentsService.verifyPayment(orderId, session.id);
      }
    }

    return { received: true };
  }
}

import { Injectable, BadRequestException } from '@nestjs/common';
import { ConfigService } from '@nestjs/config';
import { PrismaService } from '../prisma/prisma.service';
import { PaymentMethod, PaymentStatus } from '@prisma/client';
import Stripe from 'stripe';

@Injectable()
export class PaymentsService {
  private stripe: Stripe;

  constructor(
    private prisma: PrismaService,
    private configService: ConfigService,
  ) {
    this.stripe = new Stripe(
      this.configService.get<string>('STRIPE_SECRET_KEY') || 'sk_test_mock',
      {
        apiVersion: '2023-10-16' as any,
      } as import('stripe').default.StripeConfig,
    );
  }

  async createCheckoutSession(
    orderId: string,
    items: {
      product?: { title?: string };
      title?: string;
      price: number;
      quantity: number;
    }[],
    successUrl: string,
    cancelUrl: string,
  ) {
    const lineItems = items.map((item) => ({
      price_data: {
        currency: 'usd',
        product_data: {
          name: item.product?.title || item.title || 'Product Item',
        },
        unit_amount: Math.round(item.price * 100),
      },
      quantity: item.quantity,
    }));

    const session = await this.stripe.checkout.sessions.create({
      payment_method_types: ['card'],
      line_items: lineItems,
      mode: 'payment',
      success_url: successUrl,
      cancel_url: cancelUrl,
      metadata: {
        orderId: orderId,
      },
    });

    return { url: session.url, sessionId: session.id };
  }

  constructEvent(payload: string | Buffer, signature: string) {
    const endpointSecret =
      this.configService.get<string>('STRIPE_WEBHOOK_SECRET') || 'whsec_test';
    try {
      return this.stripe.webhooks.constructEvent(
        payload,
        signature,
        endpointSecret,
      );
    } catch (err: unknown) {
      const msg = err instanceof Error ? err.message : 'Unknown Error';
      throw new BadRequestException(`Webhook Error: ${msg}`);
    }
  }

  async verifyPayment(
    orderId: string,
    transactionId: string,
    method: PaymentMethod = PaymentMethod.STRIPE,
  ) {
    const order = await this.prisma.order.findUnique({
      where: { id: orderId },
    });
    if (!order) throw new BadRequestException('Order not found');

    const payment = await this.prisma.payment.create({
      data: {
        orderId,
        amount: order.totalAmount,
        method,
        status: PaymentStatus.COMPLETED,
        transactionId,
      },
    });

    await this.prisma.order.update({
      where: { id: orderId },
      data: { status: 'PROCESSING' },
    });

    return payment;
  }
}
